import React, { useRef, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import './App.css';

// Add sample images with the correct paths
const beforeAfterImages = {
  backgroundMagic: {
    before: '/images/beach-before.jpg',
    after: '/images/beach-after.jpg'
  },
  fantasyCharacters: {
    before: '/images/character-before.jpg',
    after: '/images/character-after.jpg'
  }
};

interface BeforeAfterSliderProps {
  beforeImage: string;
  afterImage: string;
}

function BeforeAfterSlider({ beforeImage, afterImage }: BeforeAfterSliderProps) {
  const sliderRef = useRef<HTMLDivElement>(null);
  const containerRef = useRef<HTMLDivElement>(null);
  const isDragging = useRef(false);

  useEffect(() => {
    const slider = sliderRef.current;
    const container = containerRef.current;

    if (!slider || !container) return;

    const updateSliderPosition = (clientX: number) => {
      const rect = container.getBoundingClientRect();
      const x = Math.min(Math.max(clientX - rect.left, 0), rect.width);
      const percent = (x / rect.width) * 100;
      slider.style.left = `${percent}%`;
      const beforeImage = container.querySelector('.before-image') as HTMLElement;
      if (beforeImage) {
        beforeImage.style.clipPath = `polygon(0 0, ${percent}% 0, ${percent}% 100%, 0 100%)`;
      }
    };

    const handleMouseDown = (e: MouseEvent) => {
      isDragging.current = true;
      updateSliderPosition(e.clientX);
    };

    const handleMouseMove = (e: MouseEvent) => {
      if (!isDragging.current) return;
      updateSliderPosition(e.clientX);
    };

    const handleMouseUp = () => {
      isDragging.current = false;
    };

    const handleTouchStart = (e: TouchEvent) => {
      isDragging.current = true;
      updateSliderPosition(e.touches[0].clientX);
    };

    const handleTouchMove = (e: TouchEvent) => {
      if (!isDragging.current) return;
      updateSliderPosition(e.touches[0].clientX);
    };

    const handleTouchEnd = () => {
      isDragging.current = false;
    };

    // Mouse events
    slider.addEventListener('mousedown', handleMouseDown);
    window.addEventListener('mousemove', handleMouseMove);
    window.addEventListener('mouseup', handleMouseUp);

    // Touch events
    slider.addEventListener('touchstart', handleTouchStart);
    window.addEventListener('touchmove', handleTouchMove);
    window.addEventListener('touchend', handleTouchEnd);

    // Initial position
    updateSliderPosition(container.getBoundingClientRect().left + container.getBoundingClientRect().width / 2);

    return () => {
      // Cleanup mouse events
      slider.removeEventListener('mousedown', handleMouseDown);
      window.removeEventListener('mousemove', handleMouseMove);
      window.removeEventListener('mouseup', handleMouseUp);

      // Cleanup touch events
      slider.removeEventListener('touchstart', handleTouchStart);
      window.removeEventListener('touchmove', handleTouchMove);
      window.removeEventListener('touchend', handleTouchEnd);
    };
  }, []);

  return (
    <div ref={containerRef} className="before-after-container">
      <div className="before-image">
        <img src={beforeImage} alt="Before" />
      </div>
      <div className="after-image">
        <img src={afterImage} alt="After" />
      </div>
      <div ref={sliderRef} className="slider-handle"></div>
    </div>
  );
}

